# Complete the isBalanced function below.
def isBalanced(s):

    # Assumptions
    # Strings only contain bracket characters (, ), {, }, [, or ].
    # See also problem constraints
    # All data fits on a single machine (see constraints)
    # return "YES" or "NO" capitalized

    # Approach, Complexity, Tradeoffs, Potential Improvements
    # Push each bracket onto a stack if it is a left bracket
    # if a right bracket pop off the top of the stack
    # if the popped is the left of the same type, then continue
    # otherwise stop and return "NO" since that means it is unmatched
    # Time Complexity O(N) since we hit each character if it is balanced
    # where N is the number of bracket characters
    # Space Complexity O(N) since we create a stack from the characters
    # if we can modify s, then we can do this in O(1) space by popping off
    # each of the characters when putting into the stack so we use a constant
    # amount of space. We would have to change to pop from the back of the
    # array to be performant and reverse our checks but all else is the same.

    # Edge Cases
    # single character
    # other edge cases captured in constraints
    # missed one - starts with left bracket

    pairs = {
        "{": "}",
        "[": "]",
        "(": ")"
    }
    stack = []

    for char in s:
        if char in pairs:
            stack.append(char)
        else:
            if stack == []:
                return "NO"
            else:
                top_item = stack.pop()
                if pairs[top_item] is not char:
                    return "NO"

    if stack != []:
        return "NO"
    else:
        return "YES"


